var container, stats;
var camera, scene, renderer, objects;
var particleLight;

function init(){

    container = document.getElementById('model');

    camera = new THREE.PerspectiveCamera(30, window.innerWidth / window.innerHeight, 1, 2000 );
    camera.position.set(1, 1, 3);

    scene = new THREE.Scene();

    // Add the COLLADA
    scene.add(dae);

    // Lights
    scene.add(new THREE.AmbientLight(0xffffff));

    // particleLight=new THREE.Mesh(new THREE.SphereGeometry(0, 0, 0), new THREE.MeshLambertMaterial({ color:0xffffff, ambient: 0xffffff, overdraw: 0.5 }));
    // scene.add(particleLight);
    
    // var directionalLight = new THREE.DirectionalLight(/*Math.random() * 0xffffff*/0xcccccc);
    // directionalLight.position.x = Math.random() - 0.5;
    // directionalLight.position.y = Math.random() - 0.5;
    // directionalLight.position.z = Math.random() - 0.5;
    // directionalLight.position.normalize();
    // scene.add(directionalLight);

    // var pointLight = new THREE.PointLight(0xffffff, 4);
    // particleLight.add(pointLight);

    renderer = new THREE.WebGLRenderer({alpha: true});
    renderer.setClearColor(0xffffff, 0)
    renderer.setPixelRatio(window.devicePixelRatio);
    renderer.setSize(window.innerWidth, window.innerHeight * .95);
    container.appendChild(renderer.domElement);

    window.addEventListener('resize', onWindowResize, false);
}

function onWindowResize() {
    camera.aspect = window.innerWidth / window.innerHeight;
    camera.updateProjectionMatrix();
    renderer.setSize(window.innerWidth, window.innerHeight);
}

function animate() {
    requestAnimationFrame(animate);
    render();
}

var clock = new THREE.Clock();

function render() {
    var timer = Date.now() * 0.0004;
    camera.position.x = Math.cos(timer) * 1.5;
    camera.position.y = .2;
    camera.position.z = Math.sin(timer) * 1.5;
    camera.lookAt(scene.position);

    // particleLight.position.x = Math.sin( timer * 1 ) * 3009;
    // particleLight.position.y = Math.cos( timer * 1 ) * 4000;
    // particleLight.position.z = Math.cos( timer * 1 ) * 3009;

    THREE.AnimationHandler.update( clock.getDelta() );
    renderer.render( scene, camera );
}

